import '@fortawesome/fontawesome-free/css/all.min.css'

const Reminder = () => {
    return (
        <div className="box">
            <div className="lalign">
                Take Medicine
            </div>
            <div className="ralign">
            <i class="fa-solid fa-sliders-simple"></i>
            <i class="fa-solid fa-toggle-on"></i>
            12:00
            </div>
        </div>
    );
}

export default Reminder;
